});
$('body').on('click', '#downloadTheme, a.download', function(e){
	e.preventDefault();
	$('#setrio-bizcal-jquery-ui-download-link-table', window.parent.document.body).show();
	$('input[name="setrio-bizcal-jquery-ui-download-link"]', window.parent.document.body).val(this.href).change().prop('disabled', false).prop('checked', true);
	$('input[name="setrio-bizcal-jquery-ui-params"]', window.parent.document.body).val(QueryString.encode($('#themeConfig').serializeArray())).change();
	return false;
})
